const BotonFormulario = (props) => {
    let button = '';
    if(props.func === null){
        button =  <button type="submit">{props.value}</button>
    }
    else{
        button =  <button type="button" onClick={props.func}>{props.value}</button>
    }
    return(
        <div>{button}</div>
    );
}

export default BotonFormulario;
